import React, { Component } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import Build from './Build/Quoting';
import Mantain from './Mantain/Mantain';
import './index.css';

class Quoting extends Component {
    constructor(props) {
        super(props);
        this.state = {
            menu: 0,
        };
    }

    renderContent() {
        switch(this.state.menu) {
            case 0:
                return (
                    <div className="menu-quoting">
                        <div className="quoting-buttons" onPress={() => this.setState({ menu: 1 })}>
                            Tengo Mi Pecera
                        </div>
                        <div className="quoting-buttons" onPress={() => this.setState({ menu: 2 })}>
                            Armar Mi Pecera
                        </div>
                    </div>
                );
                break;
            case 1:
                return (
                    <Mantain />
                );
                break;
            case 2:
                return (
                    <Build />
                );
                break;
        }
    }

    render () {
        return (
            <main className="site-main site-main-react page-spacing">
                {this.renderContent()}
            </main>
        );
    }
}

export default Quoting;
